        stack<int> nums;
        stack<char> ops;
        int num = 0;
        for (int i = 0; i < len; ++i) {
            if (s[i] == ' ') continue;
            if (s[i] >= '0' && s[i] <= '9') {
                num = num * 10 + s[i] - '0';
